import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';

import Header from './components/Header';
import LogSleep from './components/LogSleep';

import './App.css';

function App() {
  return (
    <div className="App">
      <Switch>
        <Router>
          <Header />
          <Route exact path='/' render={LogSleep} />
        </Router>
      </Switch>
    </div>

  );
}

export default App;
